import React from "react";
import { parse } from "react-papaparse";

const TestCSV =() => {

    return (
        <div>
            <h1 >Contact Import</h1>
            <div
             className={`p-6 my-2 mx-w-md border-2`}
             onDragOver={(e) => {
                 e.preventDefault();

             }}
             onDrop={(e) => {
                e.preventDefault();
                console.log(e.dataTransfer.files);
             }}
            > DROP HERE</div>
        </div>
    )
};
export default TestCSV;
